import base64
import zlib

# Nội dung mã hóa trong spamv3.py
encoded_content = b""

# Giải mã base64
decoded_base64 = base64.b64decode(encoded_content)

# Giải nén nội dung sau khi giải mã base64
decompressed_content = zlib.decompress(decoded_base64)

# In kết quả ra console
print(decompressed_content.decode('utf-8'))